   "source": [
    "# draw a plot with \"Review_Date\" as the x axis and \"Rating\" as the y axis.\n",
    "#Encode Cocoa_Percent as color.\n",
    "ggplot(chocolateData, aes(x= Review_Date, y = Rating, color = Cocoa_Percent)) + \n",
    "    geom_point() + # add a point for each data point\n",
    "    geom_jitter() + # move points slightly so they don't overlap\n",
    "    geom_smooth(method = 'lm') # add a smoothed line (lm = 'linear model')\n",
    "#`geom_smooth()` using formula = 'y ~ x'"
   ]
