   "source": [
    "That's like, kind of like the 1•5 range of Ratings.<br>\n",
    "100-40=60<br>\n",
    "60/5 = 12<br><br>\n",
    "I guess we can like multiply the ratings by 12 (12•60)<br>\n",
    "then add 40 (52•100). You know what that is close enough. I leave gap at the bottom for the non-existent 0.\n",
    "\n",
    "NVM, apparently the conversion must be 1 to 1 for axis (but not points but like axis and points need to line up so we switchign it up)<br>\n",
    "let's just multiply by 20 then (20•100)"
   ]
