   "source": [
    "#libraries (not sure what they all do)\n",
    "library(dplyr)\n",
    "library(patchwork) # To display 2 charts together\n",
    "library(hrbrthemes)\n",
    "hrbrthemes::import_roboto_condensed() #idk there was an almost error message\n",
    "\n",
    "# Values used to transform the data\n",
    "coeff <- 20\n",
    "\n",
    "# A few constants\n",
    "# rgb works too for colour btw\n",
    "CPercColor <- \"#730714\"\n",
    "CPercColor_error <- \"#D37676\" \n",
    "CPercColor_line <- \"#9D2323\"\n",
    "RatingColor <- \"#CAD20E\" \n",
    "RatingColor_error <- \"#DDEA7E\"\n",
    "RatingColor_line <- \"#7E8B1C\"\n",
    "\n",
    "avgCPavgRating <- ggplot(CPRating_summ, aes(x=Review_Date)) +\n",
    "  \n",
    "    # error bars make it look messy, but that's too bad bc I want to practice\n",
    "    geom_errorbar(aes(ymin=avgCP-sdCP, ymax=avgCP+sdCP), width=.2,\n",
    "                  position=position_dodge(.9), color=CPercColor_error) +\n",
    "    geom_smooth(aes(y=avgCP), method = stats::loess, color=CPercColor_line) +\n",
    "\n",
    "    geom_point( aes(y=avgRating * coeff), size=2, color=RatingColor) +\n",
    "    #geom_errorbar(aes(ymin=avgRating*coeff-sdRating*coeff, ymax=avgRating*coeff+sdRating*coeff), \n",
    "    #              width=.2, position=position_dodge(.9), color=RatingColor_error) +\n",
    "    geom_smooth(aes(y=avgRating * coeff), method = stats::loess, \n",
    "                color=RatingColor_line) +\n",
    "\n",
    "    geom_point( aes(y=avgCP), size=2, color=CPercColor) + \n",
    "  \n",
    "    scale_y_continuous(\n",
    "        # Features of the first axis\n",
    "        name = \"Average Cocoa Percent (%)\",\n",
    "    \n",
    "        # Add a second axis and specify its features (scale it)\n",
    "        # ~. what you are doing to get hte scale fo the second from the first\n",
    "        # aww it must be 1to1 to the original axis\n",
    "        sec.axis = sec_axis(~./coeff, name=\"Average Rating (1-5)\")\n",
    "    ) + \n",
    "  \n",
    "    theme_ipsum() +\n",
    "\n",
    "    # don't make it confusing, colour code\n",
    "    theme(\n",
    "        axis.title.y = element_text(color = CPercColor, size=13),\n",
    "        axis.title.y.right = element_text(color = RatingColor, size=13),\n",
    "        # make x axis label consistent with other labels\n",
    "        axis.title.x = element_text(color=\"#000000\", size=13)\n",
    "    ) +\n",
    "\n",
    "    ggtitle(\"Average Cocoa Percent and Average Rating\")\n",
    "\n",
    "avgCPavgRating"
   ]
  },
